        fetch("https://restcountries.com/v3.1/name/"+ id )
        .then(res=>res.json())
        .then(data=>{
            setCountry(data)
            
        })
     
    }, [])
    console.log(country);
  return (
      <div>
        {country.map(x=>
            <ul>
                <img src="" alt="" />
            </ul>)}



    </div>
  )
}

export default Details
